// Define a protocol that all our polymorphic objects will conform to
protocol PolymorphicObject {
    func process()
}

// Implement the protocol for Integer
struct IntegerPolymorphicObject: PolymorphicObject {
    var value: Int

    init(value: Int) {
        self.value = value
    }

    func process() {
        print("Processing integer \(value)")
    }
}

// Implement the protocol for String
struct StringPolymorphicObject: PolymorphicObject {
    var text: String

    init(text: String) {
        self.text = text
    }

    func process() {
        print("Processing string '\(text)'")
    }
}

// A generic function that processes any object conforming to PolymorphicObject
func processAny<T: PolymorphicObject>(object: T) {
    object.process()
}

// Example usage
let intObj = IntegerPolymorphicObject(value: 42)
let strObj = StringPolymorphicObject(text: "Hello, World!")

processAny(object: intObj) // Processing integer 42
processAny(object: strObj) // Processing string 'Hello, World!'
```

